import React, { useEffect, useState } from "react";
import Axios from "axios";


function Myblogs() {
    const [fdata, setFData] = useState([]);
  
    useEffect(() => {
      Axios.get("http://localhost:4000/book").then((res) => {
        console.log(res.data);
        setFData(res.data);
      });
    }, []);

    return (
        <>
          
          <hr></hr>
          <div>My Blogs</div>
          <div style={{ backgroundColor: "greenyellow", width: "50%" }}></div>
    
          <div>
            {fdata.map((sdata) => {
              return (
                <div
                  style={{
                    backgroundColor: "aqua",
                    width: "25%",
                    float: "left",
                    margin: "10px",
                  }}
                  key={sdata._id}
                >
                  {sdata.title}
                  <br></br>
                  {sdata.author}
                  <br></br>
                  {sdata.genre}
                  <br></br>
                  
                </div>
              );
            })}
          </div>
        </>
      );
    }
    
    export default Myblogs;
